in_source: |
  section .data:
   count: 1
   length: 0
  section .text:
     in 0
     lit length
     pop

     .loop:
          in 0
          out 1
          lit count
          push
          lit length
          push
          cmp
          drop
          drop
          jz .stop

          lit count
          push
          inc
          lit count
          pop
          jmp .loop
     .stop:
       halt
